216a97de-9e55-4af4-aa46-37852fa88330.debug:
{
  "query": "
query FocusProjectCandidateSearch($searchString: String!, $first: Int!, $after:String) {
    rateLimit{
        cost
        limit
        nodeCount
        remaining
        resetAt
        used
    }
    search(type:REPOSITORY, query:$searchString, first:$first, after:$after){
        pageInfo {
            startCursor
            hasNextPage
            endCursor
        }
        repositoryCount
        nodes{
            ...RepositorySummary
        }
    }
}
fragment RepositorySummary on Repository{
    nameWithOwner
    isInOrganization
    owner{
        login
    }
    forkCount
    stargazerCount
    pullRequests{
        totalCount
    }
    issues{
        totalCount
    }
    mentionableUsers{
        totalCount
    }
    watchers{
        totalCount
    }
    discussions{
        totalCount
    }    
    createdAt
    isPrivate
    pushedAt
    visibility
    primaryLanguage{
        name
    }
    languages(first:100){
        edges{
            size
            node{
              name
            }
        }
    }
}
",
  "variables": {
    "searchString": "is:public template:false archived:false stars:>=50 forks:>=50 size:>=1000 pushed:>=2023-12-21 created:2021-12-18..2021-12-22",
    "first": 100,
    "after": null
  }
}

